INSERT INTO `pt_pro_tenders` (`id`, `pro_id`, `pro_code`, `pro_name`, `village_code`, `tenders_code`, `transfer_year`, `transfer_month`, `tenders_desc`, `trade_area`, `lq_spl`, `lq_gyl`, `area_unit`, `lq_zs`, `lq_lmxj`, `jtzcgq_jysl`, `jtzcgq_zzgbl`, `signup_fee`, `margin`, `price_type`, `expect_price`, `expect_price_unit`, `publish_status`, `publish_date`, `publish_er`, `sz_east`, `sz_south`, `sz_west`, `sz_north`, `remark`, `fwf_status`, `fwf_souce`, `fwf_rule`, `fwf_crf_num`, `fwf_srf_num`, `status`, `is_stop`, `stop_by`, `stop_reason`, `stop_date`, `create_by`, `create_time`, `update_by`, `update_time`, `is_del`, `loss_tenders_reason`, `loss_tenders_date`, `pay_type`, `signup_notice_date`, `signup_start_date`, `signup_end_date`, `signup_address`, `signup_lxr`, `signup_lxdh`, `submit_date`, `submit_by`, `is_relisting`, `is_bg`, `bg_time`, `bg_by`, `stop_stage`, `bus_flow`, `approval_time`, `resources_message_uuid`, `unified_deal_code`, `acct_no`, `acct_no_createtime`, `bank_auth_code`, `fwf_jsfs`, `xm_ggq`, `pro_type`, `pro_child_type`, `extra_json`, `margin_pay_type`, `reg_fee_pay_type`, `is_recommend`, `real_end_date`, `price_status`) VALUES ('1802883183686529025', '1802881065130995714', '610111006P24060001', '西安市灞桥区农村集体经营性建设用地使用权网上挂牌出让', '610111006218', '001', 40, 0, '宗地位于狄寨街道塘村，宗地总面积为5532.09平方米（8.298亩）。该宗地来源合法，权属清晰，面积准确，无权属争议。商业用地，容积率不大于2.0，建筑密度不大于50%，绿地率不小于10%，地上总建筑面积不大于11064平方米（其中配套设施建筑面积约110平方米），建筑限高不应超过20米。', 5532.0900, NULL, NULL, '平方米', NULL, NULL, NULL, NULL, 0.00, 1600000.00, '0', 795.00, '万元', '1', NULL, NULL, '鲸鱼沟', '空地', '塘村村路', '空地', '<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\">西安市灞桥区农村集体经营性建设用地使用权</span></p>\n<p style=\"text-align: center;\"><span style=\"font-size: 18pt;\">网上挂牌出让公告</span></p>\n<p>&nbsp;</p>\n<p>根据《中华人民共和国民法典》《中华人民共和国土地管理法》《土地管理法实施条例》等有关规定，由西安市灞桥区狄寨街道塘村股份经济合作社申请，并经西安市人民政府核对，西安市灞桥区狄寨街道塘村股份经济合作社和城乡融合要素交易市场（西安灞桥）有限公司决定于2024年7月8日至2024年7月19日以网上挂牌方式出让1宗农村集体经营性建设用地使用权。现将有关事项公告如下：</p>\n<p>一、挂牌出让宗地基本情况</p>\n<table>\n<tbody>\n<tr>\n<td rowspan=\"2\" width=\"125\">\n<p><strong>不动产单元</strong><strong>号</strong></p>\n</td>\n<td rowspan=\"2\" width=\"117\">\n<p><strong>宗地位置</strong></p>\n</td>\n<td rowspan=\"2\" width=\"78\">\n<p><strong>宗地</strong><strong>面积</strong></p>\n<p><strong>(平方米)</strong></p>\n</td>\n<td rowspan=\"2\" width=\"96\">\n<p><strong>地上总建</strong><strong>筑面积</strong><strong>(平方</strong><strong>米)</strong></p>\n</td>\n<td rowspan=\"2\" width=\"62\">\n<p><strong>土地</strong></p>\n<p><strong>用途</strong></p>\n</td>\n<td rowspan=\"2\" width=\"54\">\n<p><strong>出让</strong></p>\n<p><strong>年限</strong></p>\n</td>\n<td rowspan=\"2\" width=\"66\">\n<p><strong>起始价</strong></p>\n<p><strong>(万元)</strong></p>\n</td>\n<td rowspan=\"2\" width=\"66\">\n<p><strong>竞买保证金(万元)</strong></p>\n</td>\n<td rowspan=\"2\" width=\"51\">\n<p><strong>增价</strong></p>\n<p><strong>幅度</strong></p>\n<p><strong>(万元)</strong></p>\n</td>\n<td colspan=\"4\" width=\"213\">\n<p><strong>主要规划指标</strong></p>\n</td>\n</tr>\n<tr>\n<td width=\"49\">\n<p><strong>容积</strong></p>\n<p><strong>率</strong></p>\n</td>\n<td width=\"52\">\n<p><strong>建筑</strong></p>\n<p><strong>密度</strong></p>\n</td>\n<td width=\"52\">\n<p><strong>绿地</strong></p>\n<p><strong>率</strong></p>\n</td>\n<td width=\"59\">\n<p><strong>建筑限高(米)</strong></p>\n</td>\n</tr>\n<tr>\n<td width=\"125\">\n<p>610111009009JB00584W00000000</p>\n</td>\n<td width=\"117\">\n<p>西安市灞桥区狄寨街道塘村，平面界址为东至鲸鱼沟、西至塘村村路、南至空地、北至空地。</p>\n</td>\n<td width=\"78\">\n<p>5532.09</p>\n<p>（8.298亩）</p>\n</td>\n<td width=\"96\">\n<p>&le;11064</p>\n<p>（其中配套设施建筑面积约110平方米）</p>\n</td>\n<td width=\"62\">\n<p>商业</p>\n</td>\n<td width=\"54\">\n<p>40年</p>\n</td>\n<td width=\"66\">\n<p>795.00</p>\n</td>\n<td width=\"66\">\n<p>160.00</p>\n</td>\n<td width=\"51\">\n<p>5.00</p>\n</td>\n<td width=\"49\">\n<p>&le;2.0</p>\n</td>\n<td width=\"52\">\n<p>&le;50%</p>\n</td>\n<td width=\"52\">\n<p>&ge;10%</p>\n</td>\n<td width=\"59\">\n<p>&le;20</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>二、中华人民共和国境内外的公司、企业、其他组织和自然人，除法律、法规和政策性文件另有规定及经核实有闲置土地、在以前土地招拍挂出让中有违约行为的单位外，均可参加竞买。</p>\n<p>三、本次农村集体经营性建设用地使用权挂牌出让在互联网上交易，即通过西安城乡融合要素交易平台进行。凡持有西安城乡融合要素交易平台注册账号、按要求足额缴纳竞买保证金的申请人，均可参加网上挂牌交易活动。西安城乡融合要素交易平台账号注册的程序及要求详见《西安城乡融合要素交易平台账户注册要求及操作指南》（获得地址为：https://www.xianchengxiangietp.com.cn/资料下载）。</p>\n<p>四、本次挂牌不接受联合竞买。</p>\n<p>五、本次农村集体经营性建设用地使用权公开出让按照价高者得为原则确定竞得人。</p>\n<p>六、挂牌时间</p>\n<p>网上挂牌期限为2024年7月8日9时至2024年7月19日16时整，申请人应当在挂牌出让结束前登录西安城乡融合要素交易平台并在系统上提交竞买申请和支付竞买保证金凭证。网上挂牌竞买保证金支付凭证提交截至时间为2024年7月17日16时整。网上挂牌报价截止期限为2024年7月19日16时整。</p>\n<p>七、本次网上挂牌出让的详细资料和具体要求，详见西安市灞桥区狄寨街道塘村农村集体经营性建设用地使用权挂牌出让文件，并以出让文件为准。有意竞买者可登录西安城乡融合要素交易平台（网址：<a href=\"https://www.xianchengxiangietp.com.cn/）查询并下载本次挂牌出让文件及附件，按上述文件规定的操作程序参加竞买。竞买人操作流程详见《\">https://www.xianchengxiangietp.com.cn/）查询并下载本次挂牌出让文件，按上述文件规定的操作程序参加竞买。竞买人操作详见《西安城乡融合要素交易平台农村集体经营性建设用地使用权交易用户操作手册》和《西安城乡融合要素交易平台农村集体经营性建设用地使用权交易指南》（获得地址为：https://www.xianchengxiangietp.com.cn/资料下载）。</a></p>\n<p>八、本次出让活动过程中，可能出现延期、中止、终止等变更情况，请在交易开始前随时关注相关公告信息。</p>\n<p>九、联系方式</p>\n<p>公告期间对本次出让宗地有异议或在出让活动过程中遇到疑难问题请致电以下电话：</p>\n<table>\n<tbody>\n<tr>\n<td width=\"23.7200%\">\n<p><strong>出让宗地咨询</strong></p>\n</td>\n<td width=\"25.5600%\">\n<p><strong>网上挂牌交易业务咨询</strong></p>\n</td>\n<td width=\"25.3400%\">\n<p><strong>网上挂牌交易技术咨询</strong></p>\n</td>\n<td width=\"25.3400%\">\n<p><strong>交易平台账号注册咨询</strong></p>\n</td>\n</tr>\n<tr>\n<td width=\"23.7200%\">\n<p>西安市灞桥区狄寨街道塘村股份经济合作社</p>\n<p>张海强</p>\n<p>15339097783</p>\n</td>\n<td width=\"25.5600%\">\n<p>城乡融合要素交易市场（西安灞桥）有限公司交易部 &nbsp;</p>\n<p>陈诚</p>\n<p>13259986975</p>\n</td>\n<td width=\"25.3400%\">\n<p>城乡融合要素交易市场（西安灞桥）有限公司信息部 &nbsp;</p>\n<p>孙巧艳</p>\n<p>13519104004</p>\n</td>\n<td width=\"25.3400%\">\n<p>城乡融合要素交易市场（西安灞桥）有限公司信息部 &nbsp;</p>\n<p>李依轩</p>\n<p>13759899702</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p style=\"text-align: right;\">西安市灞桥区狄寨街道塘村股份经济合作社&nbsp;</p>\n<p style=\"text-align: right;\">城乡融合要素交易市场（西安灞桥）有限公司</p>\n<p style=\"text-align: right;\">2024年6月18日</p>', '1', 'SFF', 'RATIO', NULL, 0.50, 9, 0, NULL, NULL, NULL, 'bqlry', '2024-06-18 13:25:43', 'bqlry', '2024-06-18 13:33:48', 0, NULL, NULL, NULL, '2024-06-18', '2024-07-08 09:00:00', '2024-07-19 16:00:00', '灞桥区城乡融合要素交易市场', '李先生', '13619265505', '2024-06-18 13:36:18', '灞桥录入员', 0, NULL, NULL, NULL, NULL, 1, '2024-06-18 14:08:56', 'afb20288-eaaa-4524-a50a-ec1501487320', 'Z99-91610132MAD5EPFK98-20240618-000001-3', NULL, NULL, NULL, NULL, NULL, 'P', 'P', NULL, NULL, NULL, 0, NULL, '0');
