让宗地基本情况</p>\n<table>\n<tbody>\n<tr>\n<td rowspan=\"2\" width=\"129\">\n<p>&nbsp;</p>\n<p>不动产单元号</p>\n</td>\n<td rowspan=\"2\" width=\"167\">\n<p>&nbsp;</p>\n<p>宗地位置</p>\n</td>\n<td rowspan=\"2\" width=\"97\">\n<p>&nbsp;</p>\n<p>宗地面积&nbsp;(平方米)</p>\n</td>\n<td rowspan=\"2\" width=\"120\">\n<p>&nbsp;</p>\n<p>地上总建筑面&nbsp;积(平方米)</p>\n</td>\n<td rowspan=\"2\" width=\"76\">\n<p>&nbsp;</p>\n<p>土地&nbsp;用途</p>\n</td>\n<td rowspan=\"2\" width=\"69\">\n<p>&nbsp;</p>\n<p>出让&nbsp;年限</p>\n</td>\n<td rowspan=\"2\" width=\"80\">\n<p>&nbsp;</p>\n<p>起始价&nbsp;(万元)</p>\n</td>\n<td rowspan=\"2\" width=\"84\">\n<p>&nbsp;</p>\n<p>竞买保证&nbsp;金(万元)</p>\n</td>\n<td rowspan=\"2\" width=\"64\">\n<p>增价</p>\n<p>幅度&nbsp;&nbsp;(万元)</p>\n</td>\n<td colspan=\"4\" width=\"266\">\n<p>主要规划指标</p>\n</td>\n</tr>\n<tr>\n<td width=\"62\">\n<p>容积</p>\n<p>率</p>\n</td>\n<td width=\"64\">\n<p>建筑&nbsp;密度</p>\n</td>\n<td width=\"65\">\n<p>绿地</p>\n<p>率</p>\n</td>\n<td width=\"74\">\n<p>建筑限&nbsp;高(米)</p>\n</td>\n</tr>\n<tr>\n<td width=\"129\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>610126009013J</p>\n<p>B00007W0000</p>\n<p>0000</p>\n</td>\n<td width=\"167\">\n<p>西安市高陵区鹿苑街道北樊村，平面界址为东至北樊村、南至北樊村、西至西韩公路、北至北樊村。</p>\n</td>\n<td width=\"97\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>6070.28</p>\n<p>(9.105亩)</p>\n</td>\n<td width=\"120\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>/</p>\n</td>\n<td width=\"76\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>物流仓&nbsp;储</p>\n</td>\n<td width=\"69\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>20年</p>\n</td>\n<td width=\"80\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>167.00</p>\n</td>\n<td width=\"84\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>70.00</p>\n</td>\n<td width=\"64\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>10.00</p>\n</td>\n<td width=\"62\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&ge;0.8</p>\n</td>\n<td width=\"64\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&ge;40%</p>\n</td>\n<td width=\"65\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&le;15%</p>\n</td>\n<td width=\"74\">\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>/</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>二、中华人民共和国境内外的公司、企业、其他组织和自然人，除法律、法规和政策性文件另有规定及经核实有闲置土地、在以前土地招拍挂出让中有违约行为的单位外，均可参加竞买。</p>\n<p>三、本次农村集体经营性建设用地使用权挂牌出让在互联网上交易，即通过西安城乡融合要素交易平台进行。凡持有西安城乡融合要素交易平台注册账号、按要求足额缴纳竞买保证金的申请人，均可参加网上挂牌交易活动。西安城乡融合要素交易平台账号注册的程序及要求详见《西安城乡融合要素交易平台账户注册要求及操作指南》</p>\n<p>(获得地址为：&nbsp;<a href=\"https://www.xianchengxiangietp.com.cn/\">https://www.xianchengxiangietp.com.cn/</a>资料下载)。</p>\n<p>四、本次挂牌不接受联合竞买。</p>\n<p>五、本次农村集体经营性建设用地使用权公开出让按照价高者得为原则确定竞得人。</p>\n<p>六、挂牌时间</p>\n<p>网上挂牌期限为2024年12月16日9时至2024年12月27日16时整，申请人应当在挂牌出让结束前登录西安城乡融合要素交易平台并在系统上提交竞买申请和支付竞买保证金凭证。网上挂牌竞买保证金支付凭证提交截至时间为2024年12月25日16时整。网上挂牌报价截止期限为2024年12月27日16时整。</p>\n<p>七、本次网上挂牌出让的详细资料和具体要求，详见西安市高陵区鹿苑街道北樊村农村集体经营性建设用地使用权挂牌出让文件及附件，并以出让文件及附件为准。有意竞买者可登录西安城乡融合要素交易平台</p>\n<p>(网址： https:/www.xianchengxiangietp.com.cn/)&nbsp; 查询并下&nbsp;载本次挂牌出让文件及附件，按上述文件规定的操作程序参加竞买。竞买人操作详见《西安&nbsp;城乡融合要素交易平台农村集体经营性建设用地使用权交易用户操作手册》和《西安城乡融&nbsp;合要素交易平台农村集体经营性建设用地使用权交易指南&nbsp;》&nbsp;(获得地址为&nbsp;：<a href=\"https://www.xianchengxiangietp.com.cn/\">https://www.xianchengxiangietp.com.cn/</a>资料下载)。</p>\n<p>八、本次出让活动过程中，可能出现延期、中止、终止等变更情况，请在交易开始前随时关注相关公告信息。</p>\n<p>九、联系方式</p>\n<p>公告期间对本次出让宗地有异议或在出让活动过程中遇到疑难问题请致电以下电话：</p>\n<table>\n<tbody>\n<tr>\n<td width=\"258\">\n<p><strong>出让宗地咨询</strong></p>\n</td>\n<td width=\"274\">\n<p><strong>网上挂牌交易业务咨询</strong></p>\n</td>\n<td width=\"273\">\n<p><strong>网上挂牌交易技术咨询</strong></p>\n</td>\n<td width=\"274\">\n<p><strong>交易平台账号注册咨询</strong></p>\n</td>\n</tr>\n<tr>\n<td width=\"258\">\n<p>西安市高陵区鹿苑街道</p>\n<p>北樊村股份经济合作</p>\n<p>联合社刘涛涛</p>\n<p>电话13572991666</p>\n</td>\n<td width=\"274\">\n<p>城乡融合要素交易市场</p>\n<p>(西安高陵)有限公司&nbsp;</p>\n<p>交易部&nbsp;张国杰</p>\n<p>电话18710888557</p>\n</td>\n<td width=\"273\">\n<p>城乡融合要素交易市场</p>\n<p>(西安高陵)有限公司</p>\n<p>信息部&nbsp;雷蕾</p>\n<p>电话17829855675</p>\n</td>\n<td width=\"274\">\n<p>城乡融合要素交易市场</p>\n<p>(西安高陵)有限公司</p>\n<p>信息部&nbsp;辛阳</p>\n<p>电话17829855675</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p style=\"text-align: right;\">西安市高陵区鹿苑街道北樊村股份经济合作联合社</p>\n<p style=\"text-align: right;\">西安市自然资源和规划局高陵分局</p>\n<p style=\"text-align: right;\">城乡融合要素交易市场(西安高陵)有限公司</p>\n<p style=\"text-align: right;\">2024年11月25日</p>', '1', 'SFF', 'RATIO', NULL, 0.50, 9, 0, NULL, NULL, NULL, 'glqlry', '2024-11-25 15:45:31', 'glqlry', '2024-11-25 16:10:12', 0, NULL, NULL, NULL, '2024-11-25', '2024-12-16 09:00:00', '2024-12-27 16:00:00', '高陵区城乡融合要素交易市场', '张先生', '18710888557', '2024-11-25 16:59:01', '高陵区录入员', 0, NULL, NULL, NULL, NULL, 1, '2024-11-25 17:29:21', 'f82cab67-b531-492d-adc5-3a4c55d8195a', 'Z99-91610132MAD5EPFK98-20241125-000001-5', NULL, NULL, NULL, NULL, NULL, 'P', 'P', NULL, NULL, NULL, 0, NULL, '0');
