4-11-27 09:12:10', '高新区发布员', 0, NULL, NULL, NULL, NULL, 1, '2024-11-27 09:26:21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'I', 'I', NULL, NULL, NULL, 0, NULL, '0');
