三年内无变更记录（2022年1月1日-2025年1月1日内）。\n（4）提供在陕西“互联网+公安政务服务”平台下载并打印法定代表人无犯罪证明（生成日期为本项目报名截止前3个月期内）。\n2、意向承租方企业必须成立5年以上，具有运营本项目交易标的能力：\n（1）企业成立满5年，营业执照记载的工商注册登记成立日期为2020年1月1日（含）之前，以提供的营业执照复印件为准；\n（2）意向承租方应具有运营本项目交易标的能力，需提供《项目筹划方案和经营管理计划》，应包含：项目目标、项目市场调研报告、经营策略、招商运营方案、项目管理、执行计划方案六个板块（格式如下，内容自拟）。\n项目筹划方案和经营管理计划\n一、项目目标\n二、项目市场调研报告\n三、经营策略\n四、招商运营方案\n五、项目管理方案\n六、执行计划\n3、意向承租方企业注册资金不少于800万元，具有法律法规规定的相关资质等级：\n（1）工商注册登记注册资本800万元及以上，以提供的营业执照复印件为准；\n（2）意向承租方应提供“电子税务局”网站查询或所在地税务机关出具的2023年度企业纳税信用等级证明或报告。\n4、意向承租方应有同类项目运营管理经验。目前有城中村项目正在运营，提供近3年支付甲方租金无断缴记录证明：\n（1）意向承租方具有3年以上（含）城中村商业运营管理经验。须提供至少一份本单位正在履约3年以上（含）的关于城中村商业租赁运营合同（出租方为村集体经济组织或村委会，合同签署日期不晚于2021年12月24日），且正在运营的商业项目单体面积规模不小于（含）本项目面积（8200㎡）；\n（2）提供三年内无断缴租金记录证明。上述正在运营项目甲方村集体组织出具证明并加盖合同对应街道办事处公章；\n（3）提供租金缴费凭证，包括：银行转账凭证或流水、出租方出具的发票或股份经济合作社统一出具的收款收据，以上凭证的载明数额、收付款的主体应与前述上游合同（商业租赁运营合同）相一致；\n（4）提供不少于3份（含）上述城中村项目运营中正在履行的的下游合同（房屋租赁合同），并提供近一年（2023年12月-2024年11月）租赁费缴费凭证，包括：银行转账凭证或流水、发票。以上凭证载明的数额、收付款的主体应与前述下游合同（房屋租赁合同）相一致；\n5、连续三年盈利，须提供有专业资质机构出具的年度财务报告。\n意向承租方提供专业机构出具的近三年〔审计年度为2021、2022、2023年)的审计报告及财务报告，报告企业利润应为正数。\n6、商业信誉良好，在以往招投标工程中无违法违纪，未曾受过任何行政处罚：\n（1）提供“信用中国”网站出具的信用信息报告（报告生成日期为本项目报名期内）；\n（2）“中国裁判文书网”官网查询截图，近三年（2022年1月1日-2025年1月1日）涉诉裁判文书不超过5条（含5条）；\n（3）“国家企业信用信息公示系统”出具的企业报告（报告生成日期为本项目报名期内），无行政处罚信息（责令停产停业、吊销营业执照），未列入严重违法失信名单（黑名单）信息；\n（4）“中国政府采购网”查询截图，无政府采购严重违法失信行为记录。\n7、提供从业人员缴纳社保记录：\n意向承租方提供本企业不少于5名（含）员工近半年城镇职工基本养老保险参保缴费证明和城镇职工基本医疗保险缴费证明。\n8、不受联合体竞价：\n意向承租方须提供关于该项目参与竞价单位非联合体承诺书，格式自拟。\n9、不允许私下转包：\n意向承租方须提供关于该项目不私自转包本项目经营权承诺书，格式自拟。\n10、以上9点需全部响应，方被认定为报名资料合格。', '1', 'SFF', 'RATIO', NULL, 0.50, 8, 0, NULL, NULL, NULL, 'xafby', '2025-01-02 10:09:41', 'xafby', '2025-01-02 13:42:52', 0, '无人竞价', '2025-01-20 17:30:02', NULL, '2025-01-02', '2025-01-02 14:00:00', '2025-01-09 14:00:00', '西安城乡融合要素交易市场', '辛女士', '02989291020', '2025-01-02 13:44:37', '市级审核员', 1, NULL, NULL, NULL, NULL, 1, '2025-01-02 13:59:58', 'd44661e0-0ede-4272-9757-5296b4799d90', 'Z99-91610132MAD5EPFK98-20250102-000002-3', NULL, NULL, NULL, NULL, NULL, 'Y', 'Y', NULL, NULL, NULL, 0, NULL, '0');
