（西安长安）有限公司，公司地址：陕西省西安市长安区郭杜街道文苑中路双创中心A座1层', '1', 'CRF,SFF', 'RATIO', 0.50, 0.50, 9, 0, NULL, NULL, NULL, 'cashy', '2025-02-12 16:49:07', '', '2025-02-12 16:49:07', 0, NULL, NULL, NULL, '2025-02-13', '2025-02-13 09:00:00', '2025-02-19 18:00:00', '长安区城乡融合要素交易市场', '李女士', '13469589500', '2025-02-12 16:58:29', '长安录入员', 0, NULL, NULL, NULL, NULL, 1, '2025-02-13 09:39:45', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'K', 'K', '{\"jyjkzffs\":\"租金五年一次性付清，无递增\",\"supplierConditions\":\"1.意向受让方应具有运营本项目交易标的能力，需提供《项目筹划方案和经营管理计划》，应包含:项目目标、项目市场调研报告、经营策略、招商运营方案、项目管理、执行计划方案六个板块(格式如下，内容自拟)。\\n            项目筹划方案和经营管理计划\\n一、项目目标\\n二、项目市场调研报告\\n三、经营策略\\n四、招商运营方案\\n五、项目管理方案\\n六、执行计划\\n2.自然人需提供公安机关出具的无犯罪记录证明；法人需提供法定代表人无犯罪记录，公安机关出具或陕西“互联网+公安政务服务”平台下载并打印法定代表人无犯罪证明。\\n3.自然人需提供中国人民银行征信中心系统的个人征信报告，不能被列为失信被执行人；法人需提供“国家企业信用信息公示系统”的报告，无行政处罚信息、未列入经营异常名录信息、未列入严重违法失信名单（黑名单）信息。\",\"dataReviewTime\":[\"2025-02-20 09:00\",\"2025-02-26 18:00\"],\"depositPaymentTime\":[\"2025-02-27 09:00\",\"2025-02-28 16:00\"]}', NULL, NULL, 0, NULL, '0');
