-25 18:00:00', '长安区城乡融合要素交易市场', '李女士', '13469589500', '2025-02-18 16:02:40', '长安录入员', 0, NULL, NULL, NULL, NULL, 1, '2025-02-19 09:01:45', '21c50678-4491-4f0f-9bbb-7c69a2072303', 'Z99-91610132MAD5EPFK98-20250219-000001-5', NULL, NULL, NULL, NULL, NULL, 'Y', 'Y', '{\"jyjkzffs\": \"租金一年一付,每3年租金上调一次，以上一年度租金价格为基数，每次递增3.3%。\",\"dataReviewTime\": [\"2025-02-26 09:00\", \"2025-03-04 18:00\"],\"depositPaymentTime\": [\"2025-03-05 09:00\", \"2025-03-06 16:00\"],\"supplierConditions\":\"意向承租方参加报名竞价响应文件应完全符合以下各项要求，响应文件每页均应加盖报名企业公章：一、意向承租方是中华人民共和国境内的依法设立并能够独立承担民事责任的企业或其他经济组织，提供五年内无法定代表人变更记录（法人死亡特殊情况除外），提供无犯罪记录证明。（一）提供企业营业执照复印件； （二）提供“国家企业信用信息公示系统”的报告（报告生成日期为本项目报名期内），证明法定代表人五年内无变更记录（2020年1月1日-2025年1月1日内）。 （三）提供在陕西“互联网+公安政务服务”平台下载并打印法定代表人无犯罪证明（生成日期为本项目报名截止前3个月期内）。二、意向承租方企业必须成立5年以上，营业执照记载的工商注册登记成立日期为2020年1月1日（含）之前，以提供的营业执照复印件为准；具有运营本项目交易标的能力：需提供《项目筹划方案和经营管理计划》（格式如下，内容自拟）。 项目筹划方案和经营管理计划1.项目目标 2.项目市场调研报告  3.经营策略4.招商运营方案 5.项目管理方案6.执行计划 三、意向承租方企业注册资金不少于1000万元，具有法律法规规定的相关资质等级： （一）、工商注册登记注册资本1000万元及以上，以提供的营业执照复印件为准； （二）、意向承租方应提供“电子税务局”网站查询或所在地税务机关出具的2023年度企业纳税信用等级证明或报告，纳税信用等级需在C级及以上。四、意向承租方应有回迁安置房项目运营管理经验。目前有回迁安置房项目正在运营，提供近3年支付甲方租金无断缴记录证明： （一）意向承租方具有3年以上（含）回迁安置房商业运营管理经验。须提供至少三份本单位正在履约3年及以上的关于回迁安置房租赁运营合同（合同签署日期不晚于2021年12月1日，合同甲方为村改社区(村民/居民委员会)或村集体合作社等，其余情形不予认可），且正在运营的回迁安置商业项目面积总计规模不小于80000㎡（含）。 （二）至少提供三份合同三年内无断缴租金记录证明并加盖交易双方公章，格式自拟。 （三）提供租金缴费凭证(股份经济合作社或村民/居民委员会出具的收款收据)。五、提供由专业机构出具的近3年〔审计年度为2021、2022、2023)审计报告，所有材料须真实有效，需要在注册会计师行业统一监管平台进行备案和赋码，企业利润数为正数。六、商业信誉良好，在以往招投标项目中无违法违纪未曾受过任何行政处罚。（一）“中国裁判文书网”官网查询截图，近三年（2022年1月1日-2025年1月1日）涉诉裁判文书数量不超过5条（含5条）；（二）“国家企业信用信息公示系统”出具的企业报告（报告生成日期为本项目报名期内），无行政处罚信息（责令停产停业、吊销营业执照），未列入严重违法失信名单（黑名单）信息； （三）“中国政府采购网”查询截图，无政府采购严重违法失信行为记录。七、提供从业人员缴纳社保记录：意向承租方提供本企业不少于20名（含）员工近半年的养老保险缴费证明。八、不接受联合体及个人竞价，意向承租方须提供关于该项目参与竞价单位非联合体承诺书，格式自拟。九、以上八点需全部响应，方被认定为报名资料合格。\"}\r', NULL, NULL, 0, NULL, '0');
