00', '西安城乡融合要素交易市场', '朱先生', '15229217193', '2025-03-07 17:49:21', '市级审核员', 0, NULL, NULL, NULL, NULL, 1, '2025-03-10 09:20:15', '0fe723ee-6379-44cd-a9fb-d99b9a62a00e', 'Z99-91610132MAD5EPFK98-20250310-000001-3', NULL, NULL, NULL, NULL, NULL, 'Y', 'Y', '{\"jyjkzffs\":\"分期支付，按年支付，在原基础上每三年递增3%\",\"dataReviewTime\":[\"2025-03-17 09:00\",\"2025-03-21 18:00\"],\"depositPaymentTime\":[\"2025-03-24 09:00\",\"2025-03-25 16:00\"],\"supplierConditions\":\"意向承租方参加报名竞价响应文件应完全符合以下各项要求，响应文件每页均应加盖报名企业公章：1、意向承租方是中华人民共和国境内的依法设立并能够独立承担民事责任的企业或其他经济组织，提供三年内无法定代表人变更记录，提供无犯罪记录证明。（1）提供企业营业执照复印件；（2）营业执照经营范围应包含租赁服务或相关业务；（3）提供“国家企业信用信息公示系统”的报告（报告生成日期为本项目报名期内），证明法定代表人三年内无变更记录（2022年1月1日-2025年1月1日内）。（4）提供在陕西“互联网+公安政务服务”平台下载并打印法定代表人无犯罪证明（生成日期为本项目报名截止前3个月期内）。2、意向承租方企业必须成立5年以上，具有运营本项目交易标的能力：（1）企业成立满5年，营业执照记载的工商注册登记成立日期为2020年1月1日（含）之前，以提供的营业执照复印件为准；（2）意向承租方应具有运营本项目交易标的能力，需提供《项目筹划方案和经营管理计划》，应包含：项目目标、项目市场调研报告、经营策略、招商运营方案、项目管理、执行计划方案六个板块（格式如下，内容自拟）。项目筹划方案和经营管理计划一、项目目标二、项目市场调研报告三、经营策略四、招商运营方案五、项目管理方案六、执行计划3、意向承租方企业注册资金不少于800万元，具有法律法规规定的相关资质等级：（1）工商注册登记注册资本800万元及以上，以提供的营业执照复印件为准；（2）意向承租方应提供“电子税务局”网站查询或所在地税务机关出具的2023年度企业纳税信用等级证明。要求B(含）级以上。4、意向承租方应有同类项目运营管理经验。目前有城中村项目正在运营，提供近3年支付甲方租金无断缴记录证明：（1）意向承租方具有3年以上（含）城中村商业运营管理经验。须提供至少一份本单位正在履约3年以上（含）的关于城中村商业租赁运营合同（出租方为村集体经济组织或村委会，合同签署日期应在2022年1月1日之前（含）），且正在运营的商业项目单体面积规模不小于（含）本项目面积（8200㎡）；（2）提供三年内（2022年，2023年，2024年度）无断缴租金记录证明。须含缴费明细表，格式自拟。上述正在运营项目由甲方村集体组织出具证明，并加盖对应街道办事处公章；（3）提供租金缴费凭证，采取银行转账方式支付租金，提供银行转账凭证或流水，并提供村集体经济合作社出具的的收款收据。（4）提供不少于3份（含）上述城中村项目运营中正在履行的的下游合同（房屋租赁合同），并提供近一年（2024年1月-2025年1月）租赁费缴费凭证，包括：银行转账凭证、流水和发票。5、连续三年盈利，须提供报名企业的年度财务报表。意向承租方提供近三年（2021、2022、2023年)的财务报表(需包含资产负债表，利润表，现金流量表），报表必须有企业负责人，主管会计签字，并加盖公章。未签字盖章视为未响应。6、商业信誉良好，在以往招投标工程中无违法违纪，未曾受过任何行政处罚：（1）提供“信用中国”网站出具的信用信息报告（报告生成日期为本项目报名期内），要求报名企业无行政处罚记录。（2）提供中国裁判文书网官网查询结果(报告生成日期为本项目报名期内）报名企业不得存在涉诉裁判文书（报名企业不得为案件当事人或第三人且不得有被执行记录）。（3）“国家企业信用信息公示系统”出具的企业报告（报告生成日期为本项目报名期内），无行政处罚信息，未列入严重违法失信名单信息。（4）“中国政府采购网”查询截图，无政府采购严重违法失信行为记录。7、提供从业人员缴纳社保记录：意向承租方提供本企业不少于5名（含）员工（2024年7月1日至2024年12月31日）城镇职工基本养老保险参保缴费证明和城镇职工基本医疗保险缴费证明；8、不受联合体竞价：意向承租方须提供关于该项目参与竞价单位非联合体承诺书，格式自拟。9、不允许私下转包：意向承租方须提供关于该项目不私自整体转包本项目经营权承诺书，格式自拟。10、以上9点需全部响应，方被认定为报名资料合格。\"}', NULL, NULL, 0, NULL, '0');
