进场施工强弱电、水、地暖完成后，付项目总额的45%，项目完工验收合格一个月内付至97%，剩余3%，12个月内无质量问题给予支付。\",\"supplierConditions\":\"1、法定代表人授权书及被授权人身份证明加盖公章（法定代表人直接参与只须提交其身份证明复印件）；\\n2、供应商应具备建筑工程施工总承包三级及以上资质或建筑装修装饰工程专业承包二级及以上资质，具有有效的安全生产许可证，提供证书复印件加盖公章；\\n3、供应商拟派项目负责人须具备建筑工程专业贰级及以上注册建造师资质、具有安全生产考核合格证（B证）提供证书复印件或相关证明材料加盖公章；\\n4、具有独立承担民事责任的能力。（注：①供应商若为企业法人：提供“统一社会信用代码营业执照”；未换证的提供“营业执照、税务登记证、组织机构代码证或三证合一的营业执照”。）\\n5、提供自2022年1月1日（含）以后在西安市范围内不少于3家社区级或村级党群服务中心建设案例合同(合同必须真实有效)。\\n6.1、须提供具备健全的财务会计制度的证明材料;(注:提供以下一项证明材料即可)：①2023或2024年度经审计的财务报告复印件(包含审计报告和审计报告中所涉及的财务报表和报表附注，审计报告须赋验证码和唯一报告编)；②供应商内部的2023或2024年度财务报表复印件(至少包含资产负债表)；③截至响应文件递交截止日一年内银行出具的资信证明(复印件);\\n6.2、须提供具有依法缴纳税收和社会保障资金的良好记录(注:提供以下一项证明材料即可)：①社会保障资金缴纳证明:提供2024年1月1日至今已缴存的任一月份的社会保障资金缴存单据或社保机构开具的社会保险参保缴费情况证明,依法不需要缴纳社会保障资金的供应商立提供相关文件证明;②提2024年1月1日至今已缴纳的至少一个月的纳税证明或完税证明，依法免税的单位应提供相关证明材料。\\n7.本项目不单独采购装修设计方案，因此意向供应商报名时须提供设计方案（格式自拟，提交即响应）;\\n8.本项目不接受联合体竞价，必须提供承诺书(格式自拟);\",\"depositPaymentTime\":[\"2025-04-27 09:00\",\"2025-04-28 16:00\"]}', NULL, NULL, 0, NULL, '0');
