L, 2, '2025-04-24 15:07:02', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'N', 'N', '{\"jyjkzffs\":\"分期支付:1、合同签订后7日内支付合同总价款的30%作为预付款;2、项目完成60%工程量可再支付合同总价款的20%做为进度款:3、项目全部完工后，支付至合同总价款的75%;4、项目竣工验收合格期支付\",\"supplierConditions\":\"1、投标人应为中华人民共和国境内注册的独立法人企业或其他组织，具备合法有效的营业执照或事业单位法人证书等国家规定的相关证明:\\n2、投标代理人应有法人授权书及被授权人身份证复印件，被授权人须提供单位劳动合同或养老保险缴纳凭证(企业法定代表人本人参加投标的，需提供法定代表人证明书及身份证复印件);\\n3、投标人须具备建设行政主管部门颁发的建筑工程施工总承包三级及以上资质，并具备有效的安全生产许可证;4、投标人拟派项目经理须具备建筑工程专业国家注册二级建造师及以上资质，同时具备有效的安全生产考核合格证(B证):投标人出具书面承诺书保证拟派项目经理未担任其它在建工程项目的项目经理，项目经理还需提供与投标人单位签署的劳动合同及养老保险缴纳凭证；\\n5、外省企业需在陕西省建筑市场监督与诚信信息一体化平台登记;\\n6、投标人信誉良好，出具“信用中国”网站(www.creditchina.gov.cn)信用报告，不得被列为失信被执行人、重大税收违法失信主体。\\n7、本项目不接受联合体投标,投标人应出具书面承诺书。\"}', NULL, NULL, 0, NULL, '0');
