业路东路沿，西至创业路西路沿，水泥硬化路区域对外出租，该区域只能用作停车场使用。(2)原宋东村停车场出租，含场地正常运行的整套升降杆系统，包括升降杆两套、摄像机两台、主机电脑1台、电脑显示器两台、计费系统1套、电源线路1套、网线系统1套，桌椅，床，被褥等一并对外承包，由经营方自负盈亏。(3)承租停车场，必须服务社会车辆，社会车辆优先。(4)承包方要确保原停车场设备，升降系统、网络、电力等能正常运行，不能损坏。经营期间支出费用全部由承租方承担，原停车场所有物资不能损坏，如有任何损坏，按原价三倍赔偿。(5)承租方在承包期间及区域内，不能做政府不允许或者违纪违法的任何事项，禁止在停车场内露天修车、改造车辆，禁止在停车场区域改造运输车，露天焊接、喷漆、收废品、堆放建筑垃圾、渣土等。如若发现，立即终止合同，不退还任何租金，并加重处罚，移交司法机构查处。(6)停车场经营期间，只能停放车辆，不允许乱搭乱建，必须听从村级上级政府部门的管理，不得私自改变本停车场用途，如若违反按3倍年承租金处罚，并合同终止。(7)禁止收留停放危险、易燃、易爆物品的车辆。(8)凡遇政府用地或村上规划使用该地块，停车场合同终止，如无违反合同的任何条款，承租费按实际用时来结算，退还剩余租费。承租方必须无条件在3日内恢复停车场原貌，承租方投资的所有物品，设施自行拆离，与宋东村集体合作经济组织无关，合同终止。(9)承租方在经营期间应维护整个停车场卫生清洁工作，更不得焚烧建筑，生活垃圾，并包括保持停车场区域、周边、路边及耕地内的环境卫生、干净整洁。(10)停车场两边的耕地区域禁止破坏、禁止乱停乱放，否则受法律制裁，合同终止。(11)要搞好停车场安全工作，不能出现打架斗殴现象发生。以上11点承租人必须承诺所有事项按合同规定要求进行，报名时附承诺书。\",\"jyjkzffs\":\"一次性支付，全部交易价款进场结算\",\"dataReviewTime\":[\"2025-06-05 09:00\",\"2025-06-11 18:00\"],\"depositPaymentTime\":[\"2025-06-12 12:00\",\"2025-06-13 16:00\"]}', NULL, NULL, 0, NULL, '0');
